import React from "react";
import Unity, { UnityContent } from "react-unity-webgl";

export class Patreon extends React.Component {
  constructor(props) {
    super(props);

    // Next up create a new Unity Content object to 
    // initialise and define your WebGL build. The 
    // paths are relative from your index file.

    this.unityContent = new UnityContent(
      "MyGame/Build.json",
      "MyGame/UnityLoader.js"
    );
  }

  render() {
    const unityContent = new UnityContent(
        "../theresume/Build/Game.json",
        "../theresume/Build/UnityLoader.js"
    );
    // Finally render the Unity component and pass 
    // the Unity content through the props.

    return (
        <Layout title = "About | AOWSAY">
            
        return( 
            <div>
                <Unity unityContent={this.unityContent} />
            </div>
        </Layout>
    )  
  }
}
export default Patreon;
